import React from 'react';
import { Link } from 'react-router-dom';
import { ArrowRight } from 'lucide-react';

function Home() {
  return (
    <div className="text-center py-20">
      <h2 className="text-4xl font-bold text-gray-800 mb-4">Simplify Your Logistics</h2>
      <p className="text-gray-600 mb-6 text-lg">Book trusted trucks for all your cargo delivery needs in minutes.</p>
      <Link
        to="/trucks"
        className="inline-flex items-center bg-blue-600 hover:bg-blue-700 text-white text-lg font-semibold px-6 py-3 rounded-full transition-all duration-300 shadow-lg"
      >
        Get Started <ArrowRight className="ml-2" />
      </Link>
    </div>
  );
}

export default Home;
